import {BroserRouter as Router, Routes, Route} from 'react-router-dom';

const App = () => {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Home />} />
            <Route path="/inici" element={<Inici/>}/>
        </Routes>
    </Router>
  )
}

export default App
